const routes = {
    unauthenticated: [
        {
            path: '/auth/signin',
            content: 'Sign In'
        },
        {
            path: '/auth/signup',
            content: 'Sign Up'
        }],
    authenticated: [
        {
            path: '/auth/profile',
            content: 'Profile'
        },
        {
            path: '/auth/logout',
            content: 'Logout'
        }]
}

export default routes;
